/** @type {HTMLCanvasElement} */

const canvas = document.getElementById('canvas1');
const ctx = canvas.getContext('2d');
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;
let particleArray = [];

let mouse = {
  x: null,
  y: null,
  radius: 120,
};

window.addEventListener('mousemove', function (event) {
  mouse.x = event.x + canvas.clientLeft / 2;
  mouse.y = event.y + canvas.clientTop / 2;
});

function drawImage() {
  let imageWidth = png.width;
  let imageHeight = png.height;
  const data = ctx.getImageData(0, 0, imageWidth, imageHeight);
  ctx.clearRect(0, 0, canvas.width, canvas.height);

  class Particle {
    constructor(x, y, color, size) {
      this.x = x + canvas.width / 2 - png.width;
      this.y = y + canvas.height / 2 - png.height;
      this.color = color;
      this.size = size;
      this.baseX = x + canvas.width / 2 - png.width;
      this.baseY = y + canvas.height / 2 - png.height;
      this.density = Math.random() * 10 + 3;
    }

    draw() {
      ctx.beginPath();
      ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
      ctx.closePath();
      ctx.fill();
    }

    update() {
      ctx.fillStyle = this.color;

      let dx = mouse.x - this.x;
      let dy = mouse.y - this.y;
      let distance = Math.hypot(dx, dy);
      let forceDirectionX = (dx / distance) * 1.2;
      let forceDIrectionY = (dy / distance) * 1.2;

      const maxDistance = 200;
      let force = (maxDistance - distance) / maxDistance;
      if (force < 0) force = 0;

      let directionX = forceDirectionX * force * this.density * 0.8;
      let directionY = forceDIrectionY * force * this.density * 0.8;

      if (distance < mouse.radius + this.size) {
        this.x -= directionX;
        this.y -= directionY;
      } else {
        if (this.x !== this.baseX) {
          let dx = this.x - this.baseX;
          this.x -= dx / 20;
        }
        if (this.y !== this.baseY) {
          let dy = this.y - this.baseY;
          this.y -= dy / 20;
        }
      }
      this.draw();
    }
  }
  function init() {
    particleArray = [];
    let step = 3;
    let particleSize = 2;

    for (let y = 0, y2 = data.height; y < y2; y += step) {
      for (let x = 0, x2 = data.width; x < x2; x += step) {
        if (data.data[y * 4 * data.width + x * 4 + 3] > 128) {
          let positionX = x;
          let positionY = y;
          let color =
            'rgb(' +
            data.data[y * 4 * data.width + x * 4] +
            ',' +
            data.data[y * 4 * data.width + x * 4 + 1] +
            ',' +
            data.data[y * 4 * data.width + x * 4 + 2] +
            ')';
          particleArray.push(new Particle(positionX * 2, positionY * 2, color, particleSize));
        }
      }
    }
  }
  function animate() {
    requestAnimationFrame(animate);
    ctx.fillStyle = 'rgba(0,0,0,0.3)';
    ctx.fillRect(0, 0, innerWidth, innerHeight);

    for (let i = 0; i < particleArray.length; i++) {
      particleArray[i].update();
    }
  }
  init();
  animate();

  window.addEventListener('resize', function () {
    canvas.width = innerWidth;
    canvas.height = innerHeight;
    init();
  });
}

const png = new Image();
png.src =
  'data:image/png;base64,';

window.addEventListener('load', (event) => {
  ctx.drawImage(png, 0, 0);
  drawImage();
});
